imipisteen latausasemien laitteita.<br>\r\nAloita vuokraus <b>valitsemalla latausasema</b>, jossa on vuokrattavia laitteita. Nämä laitteet ovat merkitty vihreällä värillä. Listalla eivät näy jo vuokratut laitteet. Mikäli laitteen akkutaso ei ole tarpeeksi korkea, laite on merkattu punaiseksi ja sitä ei voi vuokrata.<br><br>\r\nSeuraavaksi kirjoita <b>kuvaus</b> vuokraustapahtumalle. Ohjeen sisällöstä saat esimieheltäsi. Se voi olla esimerkiksi vuokraajan nimi, puhelinnumero ja osoite.<br><br>\r\nLopuksi valitse vuokrauksen <b>kesto</b>. Mahdollisia aikoja ovat 0h 0min - 23h 45min.<br><br>\r\nKun olet valmis, valitse <b>Vuokraa laite</b>.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Salasanan vaihto</b><br><br>\r\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla <b>Vaihda kieltä</b>. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Ongelmatilanne</b><br><br>\r\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1400:\"<p>Ohjeet operaattorille</p>\n<ul><li> <a href=\"#chapter1\">1. Laitteen vuokraus</a></li>\n<li> <a href=\"#chapter2\">2. Salasanan vaihto</a></li>\n<li><a href=\"#chapter3\">3. Ongelmatilanne</a></li>\n</ul><p><a name=\"chapter1\" id=\"chapter1\"></a><br />\n1. Laitteen vuokraus<br />\nOperaattorina sinulla on oikeus vuokrata toimipisteen latausasemien laitteita.<br />\nAloita vuokraus valitsemalla latausasema, jossa on vuokrattavia laitteita. Nämä laitteet ovat merkitty vihreällä värillä. Listalla eivät näy jo vuokratut laitteet. Mikäli laitteen akkutaso ei ole tarpeeksi korkea, laite on merkattu punaiseksi ja sitä ei voi vuokrata.<br />\nSeuraavaksi kirjoita kuvaus vuokraustapahtumalle. Ohjeen sisällöstä saat esimieheltäsi. Se voi olla esimerkiksi vuokraajan nimi, puhelinnumero ja osoite.<br />\nLopuksi valitse vuokrauksen kesto. Mahdollisia aikoja ovat 0h 0min - 23h 45min.<br />\nKun olet valmis, valitse Vuokraa laite.</p>\n<p><a name=\"chapter2\" id=\"chapter2\"></a><br />\n2. Salasanan vaihto<br />\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla Vaihda kieltä. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br /><a name=\"chapter3\" id=\"chapter3\"></a><br />\n3. Ongelmatilanne<br />\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"5\";}}}}',0,1396257645,1),('field:node:9002','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2374:\"<b>Ohjeet content adminille</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Tiedostojen vaihto välittömästi</a></li>\r\n<li> <a href=\"#chapter2\">2. Tiedostojen vaihto ajastetusti</a></li>\r\n<li> <a href=\"#chapter3\">3. Salasanan vaihto</a></li>\r\n<li> <a href=\"#chapter4\">4. Ongelmatilanne</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Tiedostojen vaihto välittömästi</b><br><br>\r\nContent adminina voit vaihtaa latausasemien laitteiden tiedostoja.<br><br>\r\nAloita valitsemalla <b>yritys</b> hakemistorakenteesta <b>Hallinto</b>-välilehdellä, ja sen jälkeen toimipiste. Tämän jälkeen valitse latausasema, jonka laitteiden tiedostoja haluat vaihtaa, poistaa tai lisätä.<br><br>\r\nMikäli järjestelmän valvoja on lisännyt latausasemaan tiedostopaikkoja, listataan ne oikealla puolen <b>Tiedostot</b>-välilehdellä. Tiedostopaikat listautuvat <b>ryhmien</b> alle. Valitse tiedostopaikka vaihtaaksesi tai lisätäksesi tiedoston siihen. Valitse punainen ruksi mikäli haluat poistaa tiedoston tiedostopaikasta. Poistaminen ei tuhoa itse tiedostopaikkaa, vaan voit myöhemmin valita siihen uuden tiedoston.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Tiedostojen vaihto ajastetusti</b><br><br>\r\nContent adminina voit myös vaihtaa latausasemien laitteiden tiedostoja ajastetusti.<br><br>\r\nAloita valitsemalla <b>Ajastetut päivitykset</b> kun olet valinnut hakemistopuusta latausaseman <b>Hallinta</b>-välilehdellä.<br><br>\r\nValitse seuraavaksi <b>ryhmä</b>, jonka tiedostoja haluat muuttaa, poistaa tai lisätä. Voit lisätä uuden ajastetun päivityksen valitsemalla <b>Lisää ajastettu päivitys</b>.  Määritä päivityksen ajankohta vasempaan sarakkeeseen, ja sillä ajanhetkellä päivitettävät tiedostot oikealle puolelle. Muistathan että aikaisempi päivitys ylikirjoitetaan tällä päivityksellä, joten olethan erityisen tarkka mikäli teet useita peräkkäisiä päivityksiä.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Salasanan vaihto</b><br><br>\r\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla <b>Vaihda kieltä</b>. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Ongelmatilanne</b><br><br>\r\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:2304:\"<p>Ohjeet content adminille</p>\n<ul><li> <a href=\"#chapter1\">1. Tiedostojen vaihto välittömästi</a></li>\n<li> <a href=\"#chapter2\">2. Tiedostojen vaihto ajastetusti</a></li>\n<li> <a href=\"#chapter3\">3. Salasanan vaihto</a></li>\n<li> <a href=\"#chapter4\">4. Ongelmatilanne</a></li>\n</ul><p><a name=\"chapter1\" id=\"chapter1\"></a><br />\n1. Tiedostojen vaihto välittömästi<br />\nContent adminina voit vaihtaa latausasemien laitteiden tiedostoja.<br />\nAloita valitsemalla yritys hakemistorakenteesta Hallinto-välilehdellä, ja sen jälkeen toimipiste. Tämän jälkeen valitse latausasema, jonka laitteiden tiedostoja haluat vaihtaa, poistaa tai lisätä.<br />\nMikäli järjestelmän valvoja on lisännyt latausasemaan tiedostopaikkoja, listataan ne oikealla puolen Tiedostot-välilehdellä. Tiedostopaikat listautuvat ryhmien alle. Valitse tiedostopaikka vaihtaaksesi tai lisätäksesi tiedoston siihen. Valitse punainen ruksi mikäli haluat poistaa tiedoston tiedostopaikasta. Poistaminen ei tuhoa itse tiedostopaikkaa, vaan voit myöhemmin valita siihen uuden tiedoston.</p>\n<p><a name=\"chapter2\" id=\"chapter2\"></a><br />\n2. Tiedostojen vaihto ajastetusti<br />\nContent adminina voit myös vaihtaa latausasemien laitteiden tiedostoja ajastetusti.<br />\nAloita valitsemalla Ajastetut päivitykset kun olet valinnut hakemistopuusta latausaseman Hallinta-välilehdellä.<br />\nValitse seuraavaksi ryhmä, jonka tiedostoja haluat muuttaa, poistaa tai lisätä. Voit lisätä uuden ajastetun päivityksen valitsemalla Lisää ajastettu päivitys.  Määritä päivityksen ajankohta vasempaan sarakkeeseen, ja sillä ajanhetkellä päivitettävät tiedostot oikealle puolelle. Muistathan että aikaisempi päivitys ylikirjoitetaan tällä päivityksellä, joten olethan erityisen tarkka mikäli teet useita peräkkäisiä päivityksiä.</p>\n<p><a name=\"chapter3\" id=\"chapter3\"></a><br />\n3. Salasanan vaihto<br />\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla Vaihda kieltä. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br /><a name=\"chapter4\" id=\"chapter4\"></a><br />\n4. Ongelmatilanne<br />\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"3\";}}}}',0,1396257645,1),('field:node:9003','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2448:\"<b>Ohjeet super content adminille</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Tiedostojen vaihto välittömästi</a></li>\r\n<li> <a href=\"#chapter2\">2. Tiedostojen vaihto ajastetusti</a></li>\r\n<li> <a href=\"#chapter3\">3. Salasanan vaihto</a></li>\r\n<li> <a href=\"#chapter4\">4. Ongelmatilanne</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Tiedostojen vaihto välittömästi</b><br><br>\r\nSuper content adminina voit vaihtaa latausasemien laitteiden tiedostoja missä tahansa yrityksessä.<br><br>\r\nAloita valitsemalla <b>yritys</b> hakemistorakenteesta <b>Hallinto</b>-välilehdellä, ja sen jälkeen toimipiste. Tämän jälkeen valitse latausasema, jonka laitteiden tiedostoja haluat vaihtaa, poistaa tai lisätä.<br><br>\r\nMikäli järjestelmän valvoja on lisännyt latausasemaan tiedostopaikkoja, listataan ne oikealla puolen <b>Tiedostot</b>-välilehdellä. Tiedostopaikat listautuvat <b>ryhmien</b> alle. Valitse tiedostopaikka vaihtaaksesi tai lisätäksesi tiedoston siihen. Valitse punainen ruksi mikäli haluat poistaa tiedoston tiedostopaikasta. Poistaminen ei tuhoa itse tiedostopaikkaa, vaan voit myöhemmin valita siihen uuden tiedoston.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Tiedostojen vaihto ajastetusti</b><br><br>\r\nSuper content adminina voit myös vaihtaa latausasemien laitteiden tiedostoja ajastetusti missä tahansa yrityksessä.<br><br>\r\nAloita valitsemalla <b>Ajastetut päivitykset</b> kun olet valinnut hakemistopuusta latausaseman <b>Hallinta</b>-välilehdellä.<br><br>\r\nValitse seuraavaksi <b>ryhmä</b>, jonka tiedostoja haluat muuttaa, poistaa tai lisätä. Voit lisätä uuden ajastetun päivityksen valitsemalla <b>Lisää ajastettu päivitys</b>.  Määritä päivityksen ajankohta vasempaan sarakkeeseen, ja sillä ajanhetkellä päivitettävät tiedostot oikealle puolelle. Muistathan että aikaisempi päivitys ylikirjoitetaan tällä päivityksellä, joten olethan erityisen tarkka mikäli teet useita peräkkäisiä päivityksiä.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Salasanan vaihto</b><br><br>\r\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla <b>Vaihda kieltä</b>. Tämän jäl