mpaan sarakkeeseen, ja sillä ajanhetkellä päivitettävät tiedostot oikealle puolelle. Muistathan että aikaisempi päivitys ylikirjoitetaan tällä päivityksellä, joten olethan erityisen tarkka mikäli teet useita peräkkäisiä päivityksiä.</p>\n<p><a name=\"chapter3\" id=\"chapter3\"></a><br />\n3. Salasanan vaihto<br />\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla Vaihda kieltä. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br /><a name=\"chapter4\" id=\"chapter4\"></a><br />\n4. Ongelmatilanne<br />\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"2\";}}}}',0,1396257645,1),('field:node:9004','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2956:\"<b>Ohjeet company adminille</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Käyttäjien lisäys</a></li>\r\n<li> <a href=\"#chapter2\">2. Lokien näyttäminen</a></li>\r\n<li> <a href=\"#chapter3\">3. Yrityksen, toimipisteen ja latausaseman tietojen muokkaus</a></li>\r\n<li> <a href=\"#chapter4\">4. Salasanan vaihto</a></li>\r\n<li> <a href=\"#chapter5\">5. Ongelmatilanne</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Käyttäjien lisäys</b><br><br>\r\nCompany adminina voit hallinnoida yrityksesi käyttäjiä palvelussa.<br><br>\r\na) Jos haluat lisätä uuden <b>content adminin</b> tai <b>company adminin</b>, valitse <b>Hallinto</b>-välilehdeltä yrityksesi hakemistorakenteesta.<br>\r\nb) Jos haluat lisätä uuden <b>operaattorin</b>, valitse <b>Hallinto</b>-välilehdeltä oikea toimipiste hakemistorakenteesta.<br><br>\r\nTämän jälkeen valitse <b>Käyttäjät</b>-välilehti sivun oikealta puolen. Voit muokata olemassaolevia tunnuksia valitsemalla tunnuksen listalta ja painamalla <b>Poista</b> tai <b>Muokkaa</b>. Voit lisätä uuden käyttäjän valitsemalla <b>Lisää</b> ja täyttämällä tiedot. Muistathan ilmoittaa tunnuksen ja salasanan käyttäjälle! Suosittelemme että käyttäjä vaihtaa salasanansa kirjauduttuaan palveluun.<br><br>\r\nMuistathan että sinun tulee valita oikea taso (yritys tai toimipiste) jotta voit hallinnoida tiettyjä käyttäjärooleja, kts. yllä.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Lokien näyttäminen</b><br><br>\r\nCompany adminina voit nähdä varaustapahtumista tietoja koko yrityksen laajuudelta.<br><br>\r\nValitse taso hakemistorakenteesta, jolla haluat tarkastella varauksia. Voit esimerkiksi tarkastella vain yhden latausaseman tietoja.<br><br>\r\nSeuraavaksi valitse <b>Loki</b> sivun oikealta puolelta. Valitse aikajakso jonka sisältä haluat tarkastella lokeja klikkaamalla tyhjää tilaa kalenteri-ikonin vieressä. Tämän jälkeen valitse <b>Hae lokeja</b>.<br><br>\r\nLokien avulla voit esimerkiksi nähdä lisätietoa laitteesta jota ei ole palautettu ajoissa latausasemaan.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Yrityksen, toimipisteen ja latausaseman tietojen muokkaus</b><br><br>\r\nCompany adminina voit muokata yrityksen, toimipisteen ja latausaseman tietoja.<br><br>\r\nValitse muokattava taso hakemistorakenteesta. Kaikkiin kohteisiin voi muokata <b>kuvauksen</b>. Yritykselle voit lisäksi määrittää logon, joka näkyy yrityksen käyttäjätunnuksilla sivun oikeassa yläkulmassa. Suosittelemme neliön muotoista kuvaa.\r\n<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Salasanan vaihto</b><br><br>\r\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla <b>Vaihda kieltä</b>. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br><br>\r\n<a name=\"chapter5\"></a>\r\n<b>5. Ongelmatilanne</b><br><br>\r\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:2854:\"<p>Ohjeet company adminille</p>\n<ul><li> <a href=\"#chapter1\">1. Käyttäjien lisäys</a></li>\n<li> <a href=\"#chapter2\">2. Lokien näyttäminen</a></li>\n<li> <a href=\"#chapter3\">3. Yrityksen, toimipisteen ja latausaseman tietojen muokkaus</a></li>\n<li> <a href=\"#chapter4\">4. Salasanan vaihto</a></li>\n<li> <a href=\"#chapter5\">5. Ongelmatilanne</a></li>\n</ul><p><a name=\"chapter1\" id=\"chapter1\"></a><br />\n1. Käyttäjien lisäys<br />\nCompany adminina voit hallinnoida yrityksesi käyttäjiä palvelussa.<br />\na) Jos haluat lisätä uuden content adminin tai company adminin, valitse Hallinto-välilehdeltä yrityksesi hakemistorakenteesta.<br />\nb) Jos haluat lisätä uuden operaattorin, valitse Hallinto-välilehdeltä oikea toimipiste hakemistorakenteesta.<br />\nTämän jälkeen valitse Käyttäjät-välilehti sivun oikealta puolen. Voit muokata olemassaolevia tunnuksia valitsemalla tunnuksen listalta ja painamalla Poista tai Muokkaa. Voit lisätä uuden käyttäjän valitsemalla Lisää ja täyttämällä tiedot. Muistathan ilmoittaa tunnuksen ja salasanan käyttäjälle! Suosittelemme että käyttäjä vaihtaa salasanansa kirjauduttuaan palveluun.<br />\nMuistathan että sinun tulee valita oikea taso (yritys tai toimipiste) jotta voit hallinnoida tiettyjä käyttäjärooleja, kts. yllä.</p>\n<p><a name=\"chapter2\" id=\"chapter2\"></a><br />\n2. Lokien näyttäminen<br />\nCompany adminina voit nähdä varaustapahtumista tietoja koko yrityksen laajuudelta.<br />\nValitse taso hakemistorakenteesta, jolla haluat tarkastella varauksia. Voit esimerkiksi tarkastella vain yhden latausaseman tietoja.<br />\nSeuraavaksi valitse Loki sivun oikealta puolelta. Valitse aikajakso jonka sisältä haluat tarkastella lokeja klikkaamalla tyhjää tilaa kalenteri-ikonin vieressä. Tämän jälkeen valitse Hae lokeja.<br />\nLokien avulla voit esimerkiksi nähdä lisätietoa laitteesta jota ei ole palautettu ajoissa latausasemaan.</p>\n<p><a name=\"chapter3\" id=\"chapter3\"></a><br />\n3. Yrityksen, toimipisteen ja latausaseman tietojen muokkaus<br />\nCompany adminina voit muokata yrityksen, toimipisteen ja latausaseman tietoja.<br />\nValitse muokattava taso hakemistorakenteesta. Kaikkiin kohteisiin voi muokata kuvauksen. Yritykselle voit lisäksi määrittää logon, joka näkyy yrityksen käyttäjätunnuksilla sivun oikeassa yläkulmassa. Suosittelemme neliön muotoista kuvaa.</p>\n<p><a name=\"chapter4\" id=\"chapter4\"></a><br />\n4. Salasanan vaihto<br />\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla Vaihda kieltä. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br /><a name=\"chapter5\" id=\"chapter5\"></a><br />\n5. Ongelmatilanne<br />\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"4\";}}}}',0,1396257645,1),('field:node:9005','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:234:\"Super adminina voit rajattomasti hallinnoida järjestelmää, ja olet saanut koulutuksen palvelun toiminnoista. Mikäli koet että muut super adminit tarvitsevat help-sisältöä, voit pyytää Drupal-adminia muokkaamaan tätä sivua.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:242:\"<p>Super adminina voit rajattomasti hallinnoida järjestelmää, ja olet saanut koulutuksen palvelun toiminnoista. Mikäli koet että muut super adminit tarvitsevat help-sisältöä, voit pyytää Drupal-adminia muokkaamaan tätä sivua.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"1\";}}}}',0,1396257645,1),('field:node:9017','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1435:\"<b>Help for operator</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Rent a device</a></li>\r\n<li> <a href=\"#chapter2\">2. Change password</a></li>\r\n<li><a href=\"#chapter3\">3. Troubleshooting</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Rent a device</b><br><br>\r\nAs an operator you can rent devices from your site.<br>\r\nStart by selecting a <b>charging station</b> with free devices. These devices are marked with green color. List does not include devices which are already rented. When a device\'s battery level is critically low, device is marked red and it can not be rented.<br><br>\r\nNext, write a <b>description</b> for the rent action. Your supervisor must provide you with instructions about contents. It can be e.g. customer\'s name, phone number and address.<br><br>\r\nNow select the <b>duration</b>. Possible values are between 0h 0min - 23h 45min.<br><br>\r\nWhen you\'re ready, press <b>Rent device</b>. Remember to give the PIN code to the customer before you close the popup.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Change password</b><br><br>\r\nYou can change your password by clicking your username on top right corner and selecting <b>Change password</b> from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Troubleshootin</b><br><br>\r\nWith possible trouble, contact system support or your supervisor.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1393:\"<p>Help for operator</p>\n<ul><li> <a href=\"#chapter1\">1. Rent a device</a></li>\n<li> <a href=\"#chapter2\">2. Change password</a></li>\n<li><a href=\"#chapter3\">3. Troubleshooting</a></li>\n</ul><p><a name=\"chapter1\" id=\"chapter1\"></a><br />\n1. Rent a device<br />\nAs an operator you can rent devices from your site.<br />\nStart by selecting a charging station with free devices. These devices are marked with green color. List does not include devices which are already rented. When a device\'s battery level is critically low, device is marked red and it can not be rented.<br />\nNext, write a description for the rent action. Your supervisor must provide you with instructions about contents. It can be e.g. customer\'s name, phone number and address.<br />\nNow select the duration. Possible values are between 0h 0min - 23h 45min.<br />\nWhen you\'re ready, press Rent device. Remember to give the PIN code to the customer before you close the popup.</p>\n<p><a name=\"chapter2\" id=\"chapter2\"></a><br />\n2. Change password<br />\nYou can change your password by clicking your username on top right corner and selecting Change password from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br /><a name=\"chapter3\" id=\"chapter3\"></a><br />\n3. Troubleshootin<br />\nWith possible trouble, contact system support or your supervisor.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"5\";}}}}',0,1396257645,1),('field:node:9018','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2088:\"<b>Help for content admin</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Change files immediately</a></li>\r\n<li> <a href=\"#chapter2\">2. Change files with scheduled updates</a></li>\r\n<li> <a href=\"#chapter3\">3. Change password</a></li>\r\n<li><a href=\"#chapter4\">4. Troubleshooting</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Change files immediately</b><br><br>\r\nAs an content admin you can change files in charging stations.<br>\r\nStart by selecting a company from hierarchy tree in <b>Administration</b> and then select a <b>site</b>. From that site, select a <b>charging station</b> where you want to add, change or remove files.<br>\r\nIf system admin has given you file slots to this charging station, you can see them listed on the right side of the page in <b>Files</b> tab. Click a slot to change or add a file. Click the <b>red cross</b> icon if you want to delete a file from a slot. Deleting a file does not destroy the slot, which enables you to later select a file to it.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Change files with scheduled updates</b><br><br>\r\nAs a content admin, you can also change the files with scheduled updates.<br>\r\nStart by selecting <b>Scheduled updates</b> when you have selected a charging station in <b>Administration</b> tab.<br>\r\nNext, select a group where you want to add, change or remove files. You can add a new scheduled update by selecting <b>Add scheduled update</b>. Define the execution time on the left column, and the files to update to the right side. Please remember that a previous update will be overwritten with a new update, so be extra careful if you set up multiple updates.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Change password</b><br><br>\r\nYou can change your password by clicking your username on top right corner and selecting <b>Change password</b> from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Troubleshootin</b><br><br>\r\nWith possible trouble, contact system support or your supervisor.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:2034:\"<p>Help for content admin</p>\n<ul><li> <a href=\"#chapter1\">1. Change files immediately</a></li>\n<li> <a href=\"#chapter2\">2. Change files with scheduled updates</a></li>\n<li> <a href=\"#chapter3\">3. Change password</a></li>\n<li><a href=\"#chapter4\">4. Troubleshooting</a></li>\n</ul><p><a name=\"chapter1\" id=\"chapter1\"></a><br />\n1. Change files immediately<br />\nAs an content admin you can change files in charging stations.<br />\nStart by selecting a company from hierarchy tree in Administration and then select a site. From that site, select a charging station where you want to add, change or remove files.<br />\nIf system admin has given you file slots to this charging station, you can see them listed on the right side of the page in Files tab. Click a slot to change or add a file. Click the red cross icon if you want to delete a file from a slot. Deleting a file does not destroy the slot, which enables you to later select a file to it.</p>\n<p><a name=\"chapter2\" id=\"chapter2\"></a><br />\n2. Change files with scheduled updates<br />\nAs a content admin, you can also change the files with scheduled updates.<br />\nStart by selecting Scheduled updates when you have selected a charging station in Administration tab.<br />\nNext, select a group where you want to add, change or remove files. You can add a new scheduled update by selecting Add scheduled update. Define the execution time on the left column, and the files to update to the right side. Please remember that a previous update will be overwritten with a new update, so be extra careful if you set up multiple updates.</p>\n<p><a name=\"chapter3\" id=\"chapter3\"></a><br />\n3. Change password<br />\nYou can change your password by clicking your username on top right corner and selecting Change password from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br /><a name=\"chapter4\" id=\"chapter4\"></a><br />\n4. Troubleshootin<br />\nWith possible trouble, contact system support or your supervisor.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"3\";}}}}',0,1396257645,1),('field:node:9019','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2120:\"<b>Help for content admin</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Change files immediately</a></li>\r\n<li> <a href=\"#chapter2\">2. Change files with scheduled updates</a></li>\r\n<li> <a href=\"#chapter3\">3. Change password</a></li>\r\n<li><a href=\"#chapter4\">4. Troubleshooting</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Change files immediately</b><br><br>\r\nAs an super content admin you can change files in charging stations within any company.<br>\r\nStart by selecting a company from hierarchy tree in <b>Administration</b> and then select a <b>site</b>. From that site, select a <b>charging station</b> where you want to add, change or remove files.<br>\r\nIf system admin has given you file slots to this charging station, you can see them listed on the right side of the page in <b>Files</b> tab. Click a slot to change or add a file. Click the <b>red cross</b> icon if you want to delete a file from a slot. Deleting a file does not destroy the slot, which enables you to later select a file to it.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Change files with scheduled updates</b><br><br>\r\nAs an super content admin, you can also change the files with scheduled updates.<br>\r\nStart by selecting <b>Scheduled updates</b> when you have selected a charging station in <b>Administration</b> tab.<br>\r\nNext, select a group where you want to add, change or remove files. You can add a new scheduled update by selecting <b>Add scheduled update</b>. Define the execution time on the left column, and the files to update to the right side. Please remember that a previous update will be overwritten with a new update, so be extra careful if you set up multiple updates.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Change password</b><br><br>\r\nYou can change your password by clicking your username on top right corner and selecting <b>Change password</b> from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Troubleshootin</b><br><br>\r\nWith possible trouble, contact system support or your supervisor.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:2066:\"<p>Help for content admin</p>\n<ul><li> <a href=\"#chapter1\">1. Change files immediately</a></li>\n<li> <a href=\"#chapter2\">2. Change files with scheduled updates</a></li>\n<li> <a href=\"#chapter3\">3. Change password</a></li>\n<li><a href=\"#chapter4\">4. Troubleshooting</a></li>\n</ul><p><a name=\"chapter1\" id=\"chapter1\"></a><br />\n1. Change files immediately<br />\nAs an super content admin you can change files in charging stations within any company.<br />\nStart by selecting a company from hierarchy tree in Administration and then select a site. From that site, select a charging station where you want to add, change or remove files.<br />\nIf system admin has given you file slots to this charging station, you can see them listed on the right side of the page in Files tab. Click a slot to change or add a file. Click the red cross icon if you want to delete a file from a slot. Deleting a file does not destroy the slot, which enables you to later select a file to it.</p>\n<p><a name=\"chapter2\" id=\"chapter2\"></a><br />\n2. Change files with scheduled updates<br />\nAs an super content admin, you can also change the files with scheduled updates.<br />\nStart by selecting Scheduled updates when you have selected a charging station in Administration tab.<br />\nNext, select a group where you want to add, change or remove files. You can add a new scheduled update by selecting Add scheduled update. Define the execution time on the left column, and the files to update to the right side. Please remember that a previous update will be overwritten with a new update, so be extra careful if you set up multiple updates.</p>\n<p><a name=\"chapter3\" id=\"chapter3\"></a><br />\n3. Change password<br />\nYou can change your password by clicking your username on top right corner and selecting Change password from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br /><a name=\"chapter4\" id=\"chapter4\"></a><br />\n4. Troubleshootin<br />\nWith possible trouble, contact system support or your supervisor.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"2\";}}}}',0,1396257645,1),('field:node:9041','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2643:\"<b>Help for content admin</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Administrate user accounts</a></li>\r\n<li> <a href=\"#chapter2\">2. Show logs</a></li>\r\n<li> <a href=\"#chapter3\">3. Modify company, site and charging station information</a></li>\r\n<li> <a href=\"#chapter4\">4. Change password</a></li>\r\n<li> <a href=\"#chapter5\">5. Troubleshooting</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Administrate user accounts</b><br><br>\r\nAs an company admin you can administrate your company\'s users in this system.<br>\r\na) If you want to add a new content admin or company admin, select your company from the hierarchy tree in <b>Administration</b> tab.<br>\r\nb) If you want to add a new operator, select the right site from the hierarchy tree in <b>Administration</b> tab.<br>\r\nAfter this, select <b>Users</b> from the right side of the page. You can modify existing accounts by selecting an account from the list and clicking <b>Delete</b> or <b>Modify</b>. You can add a new user by clicking <b>Add</b> and filling out needed information. Please remember to send the login credentials to the user! We suggest that the user changes his password when he logs in to the service.<br>\r\nRemember that you have to select a right level (company or site) to administer certain user roles.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Show logs</b><br><br>\r\nAs and company admin you can see logs about the rent actions in your company.<br>\r\nSelect the level from the hierarchy tree where you want to examine logs. As an example, you can view logs from a single charging station.<br>\r\nNext, select <b>Logs</b> tab from the right side of the page. Select time window for logs and click <b>Search logs</b>.<br>\r\nAs an example, logs give you insight of rent actions from the whole company level.<br>\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Modify company, site and charging station information</b><br><br>\r\nAs an company admin you can modify company, site and charging station information.<br>\r\nSelect a level from the hierarchy tree. All items have a <b>description</b>. For company, you can also define a logo, which is shown on the right top corner for company users. We highly recommend square pictures.\r\n<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Change password</b><br><br>\r\nYou can change your password by clicking your username on top right corner and selecting <b>Change password</b> from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br><br>\r\n<a name=\"chapter5\"></a>\r\n<b>5. Troubleshootin</b><br><br>\r\nWith possible trouble, contact system support or your supervisor.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:2586:\"<p>Help for content admin</p>\n<ul><li> <a href=\"#chapter1\">1. Administrate user accounts</a></li>\n<li> <a href=\"#chapter2\">2. Show logs</a></li>\n<li> <a href=\"#chapter3\">3. Modify company, site and charging station information</a></li>\n<li> <a href=\"#chapter4\">4. Change password</a></li>\n<li> <a href=\"#chapter5\">5. Troubleshooting</a></li>\n</ul><p><a name=\"chapter1\" id=\"chapter1\"></a><br />\n1. Administrate user accounts<br />\nAs an company admin you can administrate your company\'s users in this system.<br />\na) If you want to add a new content admin or company admin, select your company from the hierarchy tree in Administration tab.<br />\nb) If you want to add a new operator, select the right site from the hierarchy tree in Administration tab.<br />\nAfter this, select Users from the right side of the page. You can modify existing accounts by selecting an account from the list and clicking Delete or Modify. You can add a new user by clicking Add and filling out needed information. Please remember to send the login credentials to the user! We suggest that the user changes his password when he logs in to the service.<br />\nRemember that you have to select a right level (company or site) to administer certain user roles.</p>\n<p><a name=\"chapter2\" id=\"chapter2\"></a><br />\n2. Show logs<br />\nAs and company admin you can see logs about the rent actions in your company.<br />\nSelect the level from the hierarchy tree where you want to examine logs. As an example, you can view logs from a single charging station.<br />\nNext, select Logs tab from the right side of the page. Select time window for logs and click Search logs.<br />\nAs an example, logs give you insight of rent actions from the whole company level.</p>\n<p><a name=\"chapter3\" id=\"chapter3\"></a><br />\n3. Modify company, site and charging station information<br />\nAs an company admin you can modify company, site and charging station information.<br />\nSelect a level from the hierarchy tree. All items have a description. For company, you can also define a logo, which is shown on the right top corner for company users. We highly recommend square pictures.</p>\n<p><a name=\"chapter4\" id=\"chapter4\"></a><br />\n4. Change password<br />\nYou can change your password by clicking your username on top right corner and selecting Change password from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br /><a name=\"chapter5\" id=\"chapter5\"></a><br />\n5. Troubleshootin<br />\nWith possible trouble, contact system support or your supervisor.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"4\";}}}}',0,1396257645,1),('field:node:9050','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:222:\"As an super admin you can unlimitedly administrate the system and you have received training for functions. If you feel that other super admins need help content, you can contact Drupal admin and ask him to edit this page.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:230:\"<p>As an super admin you can unlimitedly administrate the system and you have received training for functions. If you feel that other super admins need help content, you can contact Drupal admin and ask him to edit this page.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:15:\"field_help_role\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"1\";}}}}',0,1396257645,1),('field:user:0','a:0:{}',0,1396254081,1),('field:user:1','a:0:{}',0,1396257771,1),('field_info:bundle:file:file','a:2:{s:9:\"instances\";a:0:{}s:6:\"fields\";a:0:{}}',0,1396257023,1),('field_info:bundle:node:aitico_help','a:2:{s:9:\"instances\";a:2:{s:4:\"body\";a:13:{s:5:\"label\";s:4:\"Body\";s:6:\"widget\";a:4:{s:4:\"type\";s:26:\"text_textarea_with_summary\";s:8:\"settings\";a:2:{s:4:\"rows\";i:20;s:12:\"summary_rows\";i:5;}s:6:\"weight\";s:2:\"-4\";s:6:\"module\";s:4:\"text\";}s:8:\"settings\";a:3:{s:15:\"display_summary\";b:1;s:15:\"text_processing\";i:1;s:18:\"user_register_form\";b:0;}s:7:\"display\";a:2:{s:7:\"default\";a:5:{s:5:\"label\";s:6:\"hidden\";s:4:\"type\";s:12:\"text_default\";s:8:\"settings\";a:0:{}s:6:\"module\";s:4:\"text\";s:6:\"weight\";i:0;}s:6:\"teaser\";a:5:{s:5:\"label\";s:6:\"hidden\";s:4:\"type\";s:23:\"text_summary_or_trimmed\";s:8:\"settings\";a:1:{s:11:\"trim_length\";i:600;}s:6:\"module\";s:4:\"text\";s:6:\"weight\";i:0;}}s:8:\"required\";b:0;s:11:\"description\";s:0:\"\";s:2:\"id\";s:2:\"81\";s:8:\"field_id\";s:1:\"2\";s:10:\"field_name\";s:4:\"body\";s:11:\"entity_type\";s:4:\"node\";s:6:\"bundle\";s:11:\"aitico_help\";s:7:\"deleted\";s:1:\"0\";s:13:\"default_value\";N;}s:15:\"field_help_role\";a:13:{s:5:\"label\";s:9:\"Help role\";s:6:\"widget\";a:5:{s:6:\"weight\";s:2:\"-3\";s:4:\"type\";s:14:\"options_selec