dio risus, sagittis non cursus sit amet, fe','','filtered_html'),('node','aitico_help',0,233,233,'und',0,'This is for test only.This is for test only.This is for test only.This is for test only.This is for test only.This is for test only.\r\nThis is for test only.This is for test only.This is for test only.This is for test only.\r\n\r\nCompany_help','','filtered_html'),('node','aitico_help',0,234,234,'und',0,'This is for test only.This is for test only.This is for test only.This is for test only.\r\n\r\n\r\nFor Operator!!!','','filtered_html'),('node','aitico_help',0,8347,8347,'und',0,'Only the operator can see this for English.','','filtered_html'),('node','aitico_help',0,8348,8348,'und',0,'Only the Super Admon can see this in Finnish.','','filtered_html'),('node','aitico_help',0,8999,8999,'und',0,'<b>Ohjeet operaattorille</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Laitteen vuokraus</a></li>\r\n<li> <a href=\"#chapter2\">2. Salasanan vaihto</a></li>\r\n<li><a href=\"#chapter3\">3. Ongelmatilanne</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Laitteen vuokraus</b><br><br>\r\nOperaattorina sinulla on oikeus vuokrata toimipisteen latausasemien laitteita.<br>\r\nAloita vuokraus <b>valitsemalla latausasema</b>, jossa on vuokrattavia laitteita. Nämä laitteet ovat merkitty vihreällä värillä. Listalla eivät näy jo vuokratut laitteet. Mikäli laitteen akkutaso ei ole tarpeeksi korkea, laite on merkattu punaiseksi ja sitä ei voi vuokrata.<br><br>\r\nSeuraavaksi kirjoita <b>kuvaus</b> vuokraustapahtumalle. Ohjeen sisällöstä saat esimieheltäsi. Se voi olla esimerkiksi vuokraajan nimi, puhelinnumero ja osoite.<br><br>\r\nLopuksi valitse vuokrauksen <b>kesto</b>. Mahdollisia aikoja ovat 0h 0min - 23h 45min.<br><br>\r\nKun olet valmis, valitse <b>Vuokraa laite</b>.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Salasanan vaihto</b><br><br>\r\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla <b>Vaihda kieltä</b>. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Ongelmatilanne</b><br><br>\r\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.','','filtered_html'),('node','aitico_help',0,9002,9002,'und',0,'<b>Ohjeet content adminille</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Tiedostojen vaihto välittömästi</a></li>\r\n<li> <a href=\"#chapter2\">2. Tiedostojen vaihto ajastetusti</a></li>\r\n<li> <a href=\"#chapter3\">3. Salasanan vaihto</a></li>\r\n<li> <a href=\"#chapter4\">4. Ongelmatilanne</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Tiedostojen vaihto välittömästi</b><br><br>\r\nContent adminina voit vaihtaa latausasemien laitteiden tiedostoja.<br><br>\r\nAloita valitsemalla <b>yritys</b> hakemistorakenteesta <b>Hallinto</b>-välilehdellä, ja sen jälkeen toimipiste. Tämän jälkeen valitse latausasema, jonka laitteiden tiedostoja haluat vaihtaa, poistaa tai lisätä.<br><br>\r\nMikäli järjestelmän valvoja on lisännyt latausasemaan tiedostopaikkoja, listataan ne oikealla puolen <b>Tiedostot</b>-välilehdellä. Tiedostopaikat listautuvat <b>ryhmien</b> alle. Valitse tiedostopaikka vaihtaaksesi tai lisätäksesi tiedoston siihen. Valitse punainen ruksi mikäli haluat poistaa tiedoston tiedostopaikasta. Poistaminen ei tuhoa itse tiedostopaikkaa, vaan voit myöhemmin valita siihen uuden tiedoston.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Tiedostojen vaihto ajastetusti</b><br><br>\r\nContent adminina voit myös vaihtaa latausasemien laitteiden tiedostoja ajastetusti.<br><br>\r\nAloita valitsemalla <b>Ajastetut päivitykset</b> kun olet valinnut hakemistopuusta latausaseman <b>Hallinta</b>-välilehdellä.<br><br>\r\nValitse seuraavaksi <b>ryhmä</b>, jonka tiedostoja haluat muuttaa, poistaa tai lisätä. Voit lisätä uuden ajastetun päivityksen valitsemalla <b>Lisää ajastettu päivitys</b>.  Määritä päivityksen ajankohta vasempaan sarakkeeseen, ja sillä ajanhetkellä päivitettävät tiedostot oikealle puolelle. Muistathan että aikaisempi päivitys ylikirjoitetaan tällä päivityksellä, joten olethan erityisen tarkka mikäli teet useita peräkkäisiä päivityksiä.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Salasanan vaihto</b><br><br>\r\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla <b>Vaihda kieltä</b>. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Ongelmatilanne</b><br><br>\r\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.','','filtered_html'),('node','aitico_help',0,9003,9003,'und',0,'<b>Ohjeet super content adminille</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Tiedostojen vaihto välittömästi</a></li>\r\n<li> <a href=\"#chapter2\">2. Tiedostojen vaihto ajastetusti</a></li>\r\n<li> <a href=\"#chapter3\">3. Salasanan vaihto</a></li>\r\n<li> <a href=\"#chapter4\">4. Ongelmatilanne</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Tiedostojen vaihto välittömästi</b><br><br>\r\nSuper content adminina voit vaihtaa latausasemien laitteiden tiedostoja missä tahansa yrityksessä.<br><br>\r\nAloita valitsemalla <b>yritys</b> hakemistorakenteesta <b>Hallinto</b>-välilehdellä, ja sen jälkeen toimipiste. Tämän jälkeen valitse latausasema, jonka laitteiden tiedostoja haluat vaihtaa, poistaa tai lisätä.<br><br>\r\nMikäli järjestelmän valvoja on lisännyt latausasemaan tiedostopaikkoja, listataan ne oikealla puolen <b>Tiedostot</b>-välilehdellä. Tiedostopaikat listautuvat <b>ryhmien</b> alle. Valitse tiedostopaikka vaihtaaksesi tai lisätäksesi tiedoston siihen. Valitse punainen ruksi mikäli haluat poistaa tiedoston tiedostopaikasta. Poistaminen ei tuhoa itse tiedostopaikkaa, vaan voit myöhemmin valita siihen uuden tiedoston.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Tiedostojen vaihto ajastetusti</b><br><br>\r\nSuper content adminina voit myös vaihtaa latausasemien laitteiden tiedostoja ajastetusti missä tahansa yrityksessä.<br><br>\r\nAloita valitsemalla <b>Ajastetut päivitykset</b> kun olet valinnut hakemistopuusta latausaseman <b>Hallinta</b>-välilehdellä.<br><br>\r\nValitse seuraavaksi <b>ryhmä</b>, jonka tiedostoja haluat muuttaa, poistaa tai lisätä. Voit lisätä uuden ajastetun päivityksen valitsemalla <b>Lisää ajastettu päivitys</b>.  Määritä päivityksen ajankohta vasempaan sarakkeeseen, ja sillä ajanhetkellä päivitettävät tiedostot oikealle puolelle. Muistathan että aikaisempi päivitys ylikirjoitetaan tällä päivityksellä, joten olethan erityisen tarkka mikäli teet useita peräkkäisiä päivityksiä.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Salasanan vaihto</b><br><br>\r\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla <b>Vaihda kieltä</b>. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Ongelmatilanne</b><br><br>\r\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.','','filtered_html'),('node','aitico_help',0,9004,9004,'und',0,'<b>Ohjeet company adminille</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Käyttäjien lisäys</a></li>\r\n<li> <a href=\"#chapter2\">2. Lokien näyttäminen</a></li>\r\n<li> <a href=\"#chapter3\">3. Yrityksen, toimipisteen ja latausaseman tietojen muokkaus</a></li>\r\n<li> <a href=\"#chapter4\">4. Salasanan vaihto</a></li>\r\n<li> <a href=\"#chapter5\">5. Ongelmatilanne</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Käyttäjien lisäys</b><br><br>\r\nCompany adminina voit hallinnoida yrityksesi käyttäjiä palvelussa.<br><br>\r\na) Jos haluat lisätä uuden <b>content adminin</b> tai <b>company adminin</b>, valitse <b>Hallinto</b>-välilehdeltä yrityksesi hakemistorakenteesta.<br>\r\nb) Jos haluat lisätä uuden <b>operaattorin</b>, valitse <b>Hallinto</b>-välilehdeltä oikea toimipiste hakemistorakenteesta.<br><br>\r\nTämän jälkeen valitse <b>Käyttäjät</b>-välilehti sivun oikealta puolen. Voit muokata olemassaolevia tunnuksia valitsemalla tunnuksen listalta ja painamalla <b>Poista</b> tai <b>Muokkaa</b>. Voit lisätä uuden käyttäjän valitsemalla <b>Lisää</b> ja täyttämällä tiedot. Muistathan ilmoittaa tunnuksen ja salasanan käyttäjälle! Suosittelemme että käyttäjä vaihtaa salasanansa kirjauduttuaan palveluun.<br><br>\r\nMuistathan että sinun tulee valita oikea taso (yritys tai toimipiste) jotta voit hallinnoida tiettyjä käyttäjärooleja, kts. yllä.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Lokien näyttäminen</b><br><br>\r\nCompany adminina voit nähdä varaustapahtumista tietoja koko yrityksen laajuudelta.<br><br>\r\nValitse taso hakemistorakenteesta, jolla haluat tarkastella varauksia. Voit esimerkiksi tarkastella vain yhden latausaseman tietoja.<br><br>\r\nSeuraavaksi valitse <b>Loki</b> sivun oikealta puolelta. Valitse aikajakso jonka sisältä haluat tarkastella lokeja klikkaamalla tyhjää tilaa kalenteri-ikonin vieressä. Tämän jälkeen valitse <b>Hae lokeja</b>.<br><br>\r\nLokien avulla voit esimerkiksi nähdä lisätietoa laitteesta jota ei ole palautettu ajoissa latausasemaan.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Yrityksen, toimipisteen ja latausaseman tietojen muokkaus</b><br><br>\r\nCompany adminina voit muokata yrityksen, toimipisteen ja latausaseman tietoja.<br><br>\r\nValitse muokattava taso hakemistorakenteesta. Kaikkiin kohteisiin voi muokata <b>kuvauksen</b>. Yritykselle voit lisäksi määrittää logon, joka näkyy yrityksen käyttäjätunnuksilla sivun oikeassa yläkulmassa. Suosittelemme neliön muotoista kuvaa.\r\n<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Salasanan vaihto</b><br><br>\r\nVoit vaihtaa salasanasi klikkaamalla oikeasta yläkulmasta käyttäjätunnustasi ja valitsemalla <b>Vaihda kieltä</b>. Tämän jälkeen voit valita alasvetovalikosta haluamasi kielen. Kieli vaihtuu valinnan jälkeen automaattisesti.<br><br>\r\n<a name=\"chapter5\"></a>\r\n<b>5. Ongelmatilanne</b><br><br>\r\nMahdollisen ongelmatilanteen ilmetessä ota yhteys järjestelmätukeen tai esimieheesi.','','filtered_html'),('node','aitico_help',0,9005,9005,'und',0,'Super adminina voit rajattomasti hallinnoida järjestelmää, ja olet saanut koulutuksen palvelun toiminnoista. Mikäli koet että muut super adminit tarvitsevat help-sisältöä, voit pyytää Drupal-adminia muokkaamaan tätä sivua.','','filtered_html'),('node','aitico_help',0,9017,9017,'und',0,'<b>Help for operator</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Rent a device</a></li>\r\n<li> <a href=\"#chapter2\">2. Change password</a></li>\r\n<li><a href=\"#chapter3\">3. Troubleshooting</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Rent a device</b><br><br>\r\nAs an operator you can rent devices from your site.<br>\r\nStart by selecting a <b>charging station</b> with free devices. These devices are marked with green color. List does not include devices which are already rented. When a device\'s battery level is critically low, device is marked red and it can not be rented.<br><br>\r\nNext, write a <b>description</b> for the rent action. Your supervisor must provide you with instructions about contents. It can be e.g. customer\'s name, phone number and address.<br><br>\r\nNow select the <b>duration</b>. Possible values are between 0h 0min - 23h 45min.<br><br>\r\nWhen you\'re ready, press <b>Rent device</b>. Remember to give the PIN code to the customer before you close the popup.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Change password</b><br><br>\r\nYou can change your password by clicking your username on top right corner and selecting <b>Change password</b> from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Troubleshootin</b><br><br>\r\nWith possible trouble, contact system support or your supervisor.','','filtered_html'),('node','aitico_help',0,9018,9018,'und',0,'<b>Help for content admin</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Change files immediately</a></li>\r\n<li> <a href=\"#chapter2\">2. Change files with scheduled updates</a></li>\r\n<li> <a href=\"#chapter3\">3. Change password</a></li>\r\n<li><a href=\"#chapter4\">4. Troubleshooting</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Change files immediately</b><br><br>\r\nAs an content admin you can change files in charging stations.<br>\r\nStart by selecting a company from hierarchy tree in <b>Administration</b> and then select a <b>site</b>. From that site, select a <b>charging station</b> where you want to add, change or remove files.<br>\r\nIf system admin has given you file slots to this charging station, you can see them listed on the right side of the page in <b>Files</b> tab. Click a slot to change or add a file. Click the <b>red cross</b> icon if you want to delete a file from a slot. Deleting a file does not destroy the slot, which enables you to later select a file to it.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Change files with scheduled updates</b><br><br>\r\nAs a content admin, you can also change the files with scheduled updates.<br>\r\nStart by selecting <b>Scheduled updates</b> when you have selected a charging station in <b>Administration</b> tab.<br>\r\nNext, select a group where you want to add, change or remove files. You can add a new scheduled update by selecting <b>Add scheduled update</b>. Define the execution time on the left column, and the files to update to the right side. Please remember that a previous update will be overwritten with a new update, so be extra careful if you set up multiple updates.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Change password</b><br><br>\r\nYou can change your password by clicking your username on top right corner and selecting <b>Change password</b> from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Troubleshootin</b><br><br>\r\nWith possible trouble, contact system support or your supervisor.','','filtered_html'),('node','aitico_help',0,9019,9019,'und',0,'<b>Help for content admin</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Change files immediately</a></li>\r\n<li> <a href=\"#chapter2\">2. Change files with scheduled updates</a></li>\r\n<li> <a href=\"#chapter3\">3. Change password</a></li>\r\n<li><a href=\"#chapter4\">4. Troubleshooting</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Change files immediately</b><br><br>\r\nAs an super content admin you can change files in charging stations within any company.<br>\r\nStart by selecting a company from hierarchy tree in <b>Administration</b> and then select a <b>site</b>. From that site, select a <b>charging station</b> where you want to add, change or remove files.<br>\r\nIf system admin has given you file slots to this charging station, you can see them listed on the right side of the page in <b>Files</b> tab. Click a slot to change or add a file. Click the <b>red cross</b> icon if you want to delete a file from a slot. Deleting a file does not destroy the slot, which enables you to later select a file to it.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Change files with scheduled updates</b><br><br>\r\nAs an super content admin, you can also change the files with scheduled updates.<br>\r\nStart by selecting <b>Scheduled updates</b> when you have selected a charging station in <b>Administration</b> tab.<br>\r\nNext, select a group where you want to add, change or remove files. You can add a new scheduled update by selecting <b>Add scheduled update</b>. Define the execution time on the left column, and the files to update to the right side. Please remember that a previous update will be overwritten with a new update, so be extra careful if you set up multiple updates.\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Change password</b><br><br>\r\nYou can change your password by clicking your username on top right corner and selecting <b>Change password</b> from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Troubleshootin</b><br><br>\r\nWith possible trouble, contact system support or your supervisor.','','filtered_html'),('node','aitico_help',0,9041,9041,'und',0,'<b>Help for content admin</b><br><br>\r\n<ul>\r\n<li> <a href=\"#chapter1\">1. Administrate user accounts</a></li>\r\n<li> <a href=\"#chapter2\">2. Show logs</a></li>\r\n<li> <a href=\"#chapter3\">3. Modify company, site and charging station information</a></li>\r\n<li> <a href=\"#chapter4\">4. Change password</a></li>\r\n<li> <a href=\"#chapter5\">5. Troubleshooting</a></li>\r\n</ul>\r\n<br><br>\r\n<a name=\"chapter1\"></a>\r\n<b>1. Administrate user accounts</b><br><br>\r\nAs an company admin you can administrate your company\'s users in this system.<br>\r\na) If you want to add a new content admin or company admin, select your company from the hierarchy tree in <b>Administration</b> tab.<br>\r\nb) If you want to add a new operator, select the right site from the hierarchy tree in <b>Administration</b> tab.<br>\r\nAfter this, select <b>Users</b> from the right side of the page. You can modify existing accounts by selecting an account from the list and clicking <b>Delete</b> or <b>Modify</b>. You can add a new user by clicking <b>Add</b> and filling out needed information. Please remember to send the login credentials to the user! We suggest that the user changes his password when he logs in to the service.<br>\r\nRemember that you have to select a right level (company or site) to administer certain user roles.\r\n<br><br>\r\n<a name=\"chapter2\"></a>\r\n<b>2. Show logs</b><br><br>\r\nAs and company admin you can see logs about the rent actions in your company.<br>\r\nSelect the level from the hierarchy tree where you want to examine logs. As an example, you can view logs from a single charging station.<br>\r\nNext, select <b>Logs</b> tab from the right side of the page. Select time window for logs and click <b>Search logs</b>.<br>\r\nAs an example, logs give you insight of rent actions from the whole company level.<br>\r\n<br><br>\r\n<a name=\"chapter3\"></a>\r\n<b>3. Modify company, site and charging station information</b><br><br>\r\nAs an company admin you can modify company, site and charging station information.<br>\r\nSelect a level from the hierarchy tree. All items have a <b>description</b>. For company, you can also define a logo, which is shown on the right top corner for company users. We highly recommend square pictures.\r\n<br><br>\r\n<a name=\"chapter4\"></a>\r\n<b>4. Change password</b><br><br>\r\nYou can change your password by clicking your username on top right corner and selecting <b>Change password</b> from the drop-down list. Then you can select desired language from a list. Language updates automatically after selection.<br><br>\r\n<a name=\"chapter5\"></a>\r\n<b>5. Troubleshootin</b><br><br>\r\nWith possible trouble, contact system support or your supervisor.','','filtered_html'),('node','aitico_help',0,9050,9050,'und',0,'As an super admin you can unlimitedly administrate the system and you have received training for functions. If you feel that other super admins need help content, you can contact Drupal admin and ask him to edit this page.','','filtered_html');
