default','A confirmation request to cancel your account has been sent to your e-mail address.','','7.22'),(1598,'/fi/user/22/cancel','default','When cancelling the account','','7.22'),(1599,'/fi/user/22/cancel','default','Are you sure you want to cancel the account %name?','','7.22'),(1600,'/fi/administration','default','Factory-test','','7.22'),(1601,'/fi/administration','default','Tampere','','7.22'),(1602,'/fi/administration','default','tehdas testi','','7.22'),(1603,'/fi/administration/user/edit/30','default','User has been updated successfully','','7.22'),(1604,'/fi/user/30/cancel','default','Cancelling account','','7.22'),(1605,'/fi/user/30/cancel','default','Processing','','7.22'),(1606,'/fi/user/30/cancel','default','Initializing.','','7.22'),(1607,'/fi/user/30/cancel','default','Completed @current of @total.','','7.22'),(1608,'/fi/user/30/cancel','default','An error has occurred.','','7.22'),(1609,'/fi/user/30/cancel','default','The update has been performed.','','7.22'),(1610,'/fi/user/30/cancel','default','Cancelling user account','','7.22'),(1611,'/fi/user/30/cancel','default','Please continue to <a href=\"@error_url\">the error page</a>','','7.22'),(1612,'/fi/batch?id=97&op=do','default','%name has been deleted.','','7.22'),(1613,'/fi/administration','default','<em class=\"placeholder\">esty_test6</em> has been deleted.','','7.22'),(1614,'/fi/user/30/cancel','default','The requested page \"/fi/user/30/cancel\" could not be found.','','7.22'),(1615,'/admin/dashboard?render=overlay','default','(empty)','','7.22'),(1616,'/admin/dashboard?render=overlay','default','This dashboard region is empty. Click <em>Customize dashboard</em> to add blocks to it.','','7.22'),(1617,'/admin/dashboard?render=overlay','default','DRAG HERE','','7.22'),(1618,'/admin/dashboard?render=overlay','default','To customize the dashboard page, move blocks to the dashboard regions on the <a href=\"@dashboard\">Dashboard administration page</a>, or enable JavaScript on this page to use the drag-and-drop interface.','','7.22'),(1619,'/admin/dashboard?render=overlay','default','There is currently 1 user online.','','7.22'),(1620,'/admin/dashboard?render=overlay','default','Show more content','','7.22'),(1621,'/admin/dashboard?render=overlay','default','More','','7.22'),(1622,'/admin/dashboard?render=overlay','default','Configure available dashboard blocks','','7.22'),(1623,'/admin/dashboard?render=overlay','default','Configure which blocks can be shown on the dashboard.','','7.22'),(1624,'/admin/dashboard?render=overlay','default','Customize your dashboard.','','7.22'),(1625,'/admin/help?render=overlay','default','Help topics','','7.22'),(1626,'/admin/help?render=overlay','default','Help is available on the following items:','','7.22'),(1627,'/admin/help?render=overlay','default','Allows users to have persistent sessions via a checkbox \"Remember me\" on the login form.','','7.22'),(1628,'/admin/help?render=overlay','default','About','','7.22'),(1629,'/admin/help?render=overlay','default','The Block module allows you to create boxes of content, which are rendered into an area, or region, of one or more pages of a website. The core Seven administration theme, for example, implements the regions \"Content\", \"Help\", \"Dashboard main\", and \"Dashboard sidebar\", and a block may appear in any one of these regions. The <a href=\"@blocks\">Blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. For more information, see the online handbook entry for <a href=\"@block\">Block module</a>.','','7.22'),(1630,'/admin/help?render=overlay','default','Uses','','7.22'),(1631,'/admin/help?render=overlay','default','Positioning content','','7.22'),(1632,'/admin/help?render=overlay','default','When working with blocks, remember that all themes do <em>not</em> implement the same regions, or display regions in the same way. Blocks are positioned on a per-theme basis. Users with the <em>Administer blocks</em> permission can disable blocks. Disabled blocks are listed on the <a href=\"@blocks\">Blocks administration page</a>, but are not displayed in any region.','','7.22'),(1633,'/admin/help?render=overlay','default','Controlling visibility','','7.22'),(1634,'/admin/help?render=overlay','default','Blocks can be configured to be visible only on certain pages, only to users of certain roles, or only on pages displaying certain <a href=\"@content-type\">content types</a>. Administrators can also allow specific blocks to be enabled or disabled by users when they edit their <a href=\"@user\">My account</a> page. Some dynamic blocks, such as those generated by modules, will be displayed only on certain pages.','','7.22'),(1635,'/admin/help?render=overlay','default','Creating custom blocks','','7.22'),(1636,'/admin/help?render=overlay','default','Users with the <em>Administer blocks</em> permission can <a href=\"@block-add\">add custom blocks</a>, which are then listed on the <a href=\"@blocks\">Blocks administration page</a>. Once created, custom blocks behave just like default and module-generated blocks.','','7.22'),(1637,'/admin/help?render=overlay','default','The Contextual links module displays links related to regions of pages on your site to users with <em>access contextual links</em> permission. For more information, see the online handbook entry for <a href=\"@contextual\">Contextual links module</a>.','','7.22'),(1638,'/admin/help?render=overlay','default','Displaying contextual links','','7.22'),(1639,'/admin/help?render=overlay','default','Contextual links are supplied by modules, to give you quick access to tasks associated with regions of pages on your site. For instance, if you have a custom menu block displayed in a sidebar of your site, the Blocks and Menus modules will supply links to configure the block and edit the menu. The Contextual links module collects these links into a list for display by your theme, and also adds JavaScript code to the page to hide the links initially, and display them when your mouse hovers over the block.','','7.22'),(1640,'/admin/help?render=overlay','default','The Dashboard module provides a <a href=\"@dashboard\">Dashboard page</a> in the administrative interface for organizing administrative tasks and navigation, and tracking information within your site. The Dashboard page contains blocks, which you can add to and arrange using the drag-and-drop interface that appears when you click on the <em>Customize dashboard</em> link. Within this interface, blocks that are not primarily used for site administration do not appear by default, but can be added via the <em>Add other blocks</em> link. For more information, see the online handbook entry for <a href=\"@handbook\">Dashboard module</a>.','','7.22'),(1641,'/admin/help?render=overlay','default','Tracking user activity','','7.22'),(1642,'/admin/help?render=overlay','default','By enabling blocks such as <em>Who\'s online</em> and <em>Who\'s new</em>, site users can track who is logged in and new user signups at a centralized location.','','7.22'),(1643,'/admin/help?render=overlay','default','Tracking content activity','','7.22'),(1644,'/admin/help?render=overlay','default','By enabling blocks such as <em>Recent blog posts</em>, <em>New forum topics</em> and <em>Recent comments</em>, site users can view newly added site content at a glance.','','7.22'),(1645,'/admin/help?render=overlay','default','The Database logging module logs system events in the Drupal database. For more information, see the online handbook entry for the <a href=\"@dblog\">Database logging module</a>.','','7.22'),(1646,'/admin/help?render=overlay','default','Monitoring your site','','7.22'),(1647,'/admin/help?render=overlay','default','The Database logging module allows you to view an event log on the <a href=\"@dblog\">Recent log messages</a> page. The log is a chronological list of recorded events containing usage data, performance data, errors, warnings and operational information. Administrators should check the log on a regular basis to ensure their site is working properly.','','7.22'),(1648,'/admin/help?render=overlay','default','Debugging site problems','','7.22'),(1649,'/admin/help?render=overlay','default','In case of errors or problems with the site, the <a href=\"@dblog\">Recent log messages</a> page can be useful for debugging, since it shows the sequence of events. The log messages include usage information, warnings, and errors.','','7.22'),(1650,'/admin/help?render=overlay','default','The Field module allows custom data fields to be defined for <em>entity</em> types (entities include content items, comments, user accounts, and taxonomy terms). The Field module takes care of storing, loading, editing, and rendering field data. Most users will not interact with the Field module directly, but will instead use the <a href=\"@field-ui-help\">Field UI module</a> user interface. Module developers can use the Field API to make new entity types \"fieldable\" and thus allow fields to be attached to them. For more information, see the online handbook entry for <a href=\"@field\">Field module</a>.','','7.22'),(1651,'/admin/help?render=overlay','default','Enabling field types','','7.22'),(1652,'/admin/help?render=overlay','default','The Field module provides the infrastructure for fields and field attachment; the field types and input widgets themselves are provided by additional modules. Some of the modules are required; the optional modules can be enabled from the <a href=\"@modules\">Modules administration page</a>. Drupal core includes the following field type modules: Number (required), Text (required), List (required), Taxonomy (optional), Image (optional), and File (optional); the required Options module provides input widgets for other field modules. Additional fields and widgets may be provided by contributed modules, which you can find in the <a href=\"@contrib\">contributed module section of Drupal.org</a>. Currently enabled field and input widget modules:','','7.22'),(1653,'/admin/help?render=overlay','default','Managing field data storage','','7.22'),(1654,'/admin/help?render=overlay','default','Developers of field modules can either use the default <a href=\"@sql-store\">Field SQL storage module</a> to store data for their fields, or a contributed or custom module developed using the <a href=\"@storage-api\">field storage API</a>.','','7.22'),(1655,'/admin/help?render=overlay','default','The Field SQL storage module stores field data in the database. It is the default field storage module; other field storage mechanisms may be available as contributed modules. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.22'),(1656,'/admin/help?render=overlay','default','The Field UI module provides an administrative user interface (UI) for attaching and managing fields. Fields can be defined at the content-type level for content items and comments, at the vocabulary level for taxonomy terms, and at the site level for user accounts. Other modules may also enable fields to be defined for their data. Field types (text, image, number, etc.) are defined by modules, and collected and managed by the <a href=\"@field\">Field module</a>. For more information, see the online handbook entry for <a href=\"@field_ui\" target=\"_blank\">Field UI module</a>.','','7.22'),(1657,'/admin/help?render=overlay','default','Planning fields','','7.22'),(1658,'/admin/help?render=overlay','default','There are several decisions you will need to make before defining a field for content, comments, etc.:','','7.22'),(1659,'/admin/help?render=overlay','default','What the field will be called','','7.22'),(1660,'/admin/help?render=overlay','default','A field has a <em>label</em> (the name displayed in the user interface) and a <em>machine name</em> (the name used internally). The label can be changed after you create the field, if needed, but the machine name cannot be changed after you have created the field.','','7.22'),(1661,'/admin/help?render=overlay','default','What type of data the field will store','','7.22'),(1662,'/admin/help?render=overlay','default','Each field can store one type of data (text, number, file, etc.). When you define a field, you choose a particular <em>field type</em>, which corresponds to the type of data you want to store. The field type cannot be changed after you have created the field.','','7.22'),(1663,'/admin/help?render=overlay','default','How the data will be input and displayed','','7.22'),(1664,'/admin/help?render=overlay','default','Each field type has one or more available <em>widgets</em> associated with it; each widget provides a mechanism for data input when you are editing (text box, select list, file upload, etc.). Each field type also has one or more display options, which determine how the field is displayed to site visitors. The widget and display options can be changed after you have created the field.','','7.22'),(1665,'/admin/help?render=overlay','default','How many values the field will store','','7.22'),(1666,'/admin/help?render=overlay','default','You can store one value, a specific maximum number of values, or an unlimited number of values in each field. For example, an employee identification number field might store a single number, whereas a phone number field might store multiple phone numbers. This setting can be changed after you have created the field, but if you reduce the maximum number of values, you may lose information.','','7.22'),(1667,'/admin/help?render=overlay','default','Reusing fields','','7.22'),(1668,'/admin/help?render=overlay','default','Once you have defined a field, you can reuse it. For example, if you define a custom image field for one content type, and you need to have an image field with the same parameters on another content type, you can add the same field to the second content type, in the <em>Add existing field</em> area of the user interface. You could also add this field to a taxonomy vocabulary, comments, user accounts, etc.','','7.22'),(1669,'/admin/help?render=overlay','default','Some settings of a reused field are unique to each use of the field; others are shared across all places you use the field. For example, the label of a text field is unique to each use, while the setting for the number of values is shared.','','7.22'),(1670,'/admin/help?render=overlay','default','There are two main reasons for reusing fields. First, reusing fields can save you time over defining new fields. Second, reusing fields also allows you to display, filter, group, and sort content together by field across content types. For example, the contributed Views module allows you to create lists and tables of content. So if you use the same field on multiple content types, you can create a View containing all of those content types together displaying that field, sorted by that field, and/or filtered by that field.','','7.22'),(1671,'/admin/help?render=overlay','default','Fields on content items','','7.22'),(1672,'/admin/help?render=overlay','default','Fields on content items are defined at the content-type level, on the <em>Manage fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you define a field for a content type, each content item of that type will have that field added to it. Some fields, such as the Title and Body, are provided for you when you create a content type, or are provided on content types created by your installation profile.','','7.22'),(1673,'/admin/help?render=overlay','default','Fields on taxonomy terms','','7.22'),(1674,'/admin/help?render=overlay','default','Fields on taxonomy terms are defined at the taxonomy vocabulary level, on the <em>Manage fields</em> tab of the vocabulary edit page (which you can reach from the <a href=\"@taxonomy\">Taxonomy page</a>). When you define a field for a vocabulary, each term in that vocabulary will have that field added to it. For example, you could define an image field for a vocabulary to store an icon with each term.','','7.22'),(1675,'/admin/help?render=overlay','default','Fields on user accounts','','7.22'),(1676,'/admin/help?render=overlay','default','Fields on user accounts are defined on a site-wide basis on the <a href=\"@fields\">Manage fields tab</a> of the <a href=\"@accounts\">Account settings</a> page. When you define a field for user accounts, each user account will have that field added to it. For example, you could add a long text field to allow users to include a biography.','','7.22'),(1677,'/admin/help?render=overlay','default','Fields on comments','','7.22'),(1678,'/admin/help?render=overlay','default','Fields on comments are defined at the content-type level, on the <em>Comment fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you add a field for comments, each comment on a content item of that type will have that field added to it. For example, you could add a website field to the comments on forum posts, to allow forum commenters to add a link to their website.','','7.22'),(1679,'/admin/help?render=overlay','default','The File module defines a <em>File</em> field type for the Field module, which lets you manage and validate uploaded files attached to content on your site (see the <a href=\"@field-help\">Field module help page</a> for more information about fields). For more information, see the online handbook entry for <a href=\"@file\">File module</a>.','','7.22'),(1680,'/admin/help?render=overlay','default','Attaching files to content','','7.22'),(1681,'/admin/help?render=overlay','default','The File module allows users to attach files to content (e.g., PDF files, spreadsheets, etc.), when a <em>File</em> field is added to a given content type using the <a href=\"@fieldui-help\">Field UI module</a>. You can add validation options to your File field, such as specifying a maximum file size and allowed file extensions.','','7.22'),(1682,'/admin/help?render=overlay','default','Managing attachment display','','7.22'),(1683,'/admin/help?render=overlay','default','When you attach a file to content, you can specify whether it is <em>listed</em> or not. Listed files are displayed automatically in a section at the bottom of your content; non-listed files are available for embedding in your content, but are not included in the list at the bottom.','','7.22'),(1684,'/admin/help?render=overlay','default','Managing file locations','','7.22'),(1685,'/admin/help?render=overlay','default','When you create a File field, you can specify a directory where the files will be stored, which can be within either the <em>public</em> or <em>private</em> files directory. Files in the public directory can be accessed directly through the web server; when public files are listed, direct links to the files are used, and anyone who knows a file\'s URL can download the file. Files in the private directory are not accessible directly through the web server; when private files are listed, the links are Drupal path requests. This adds to server load and download time, since Drupal must start up and resolve the path for each file download request, but allows for access restrictions.','','7.22'),(1686,'/admin/help?render=overlay','default','The Filter module allows administrators to configure text formats. A text format defines the HTML tags, codes, and other input allowed in content and comments, and is a key feature in guarding against potentially damaging input from malicious users. For more information, see the online handbook entry for <a href=\"@filter\">Filter module</a>.','','7.22'),(1687,'/admin/help?render=overlay','default','Configuring text formats','','7.22'),(1688,'/admin/help?render=overlay','default','Configure text formats on the <a href=\"@formats\">Text formats page</a>. <strong>Improper text format configuration is a security risk</strong>. To ensure security, untrusted users should only have access to text formats that restrict them to either plain text or a safe set of HTML tags, since certain HTML tags can allow embedding malicious links or scripts in text. More trusted registered users may be granted permission to use less restrictive text formats in order to create rich content.','','7.22'),(1689,'/admin/help?render=overlay','default','Applying filters to text','','7.22'),(1690,'/admin/help?render=overlay','default','Each text format uses filters to manipulate text, and most formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes, or transforms elements within user-entered text before it is displayed. A filter does not change the actual content, but instead, modifies it temporarily before it is displayed. One filter may remove unapproved HTML tags, while another automatically adds HTML to make URLs display as clickable links.','','7.22'),(1691,'/admin/help?render=overlay','default','Defining text formats','','7.22'),(1692,'/admin/help?render=overlay','default','One format is included by default: <em>Plain text</em> (which removes all HTML tags). Additional formats may be created by your installation profile when you install Drupal, and more can be created by an administrator on the <a href=\"@text-formats\">Text formats page</a>.','','7.22'),(1693,'/admin/help?render=overlay','default','Choosing a text format','','7.22'),(1694,'/admin/help?render=overlay','default','Users with access to more than one text format can use the <em>Text format</em> fieldset to choose between available text formats when creating or editing multi-line content. Administrators can define the text formats available to each user role, and control the order of formats listed in the <em>Text format</em> fieldset on the <a href=\"@text-formats\">Text formats page</a>.','','7.22'),(1695,'/admin/help?render=overlay','default','The Help module provides <a href=\"@help-page\">Help reference pages</a> and context-sensitive advice to guide you through the use and configuration of modules. It is a starting point for the online <a href=\"@handbook\">Drupal handbooks</a>. The handbooks contain more extensive and up-to-date information, are annotated with user-contributed comments, and serve as the definitive reference point for all Drupal documentation. For more information, see the online handbook entry for the <a href=\"@help\">Help module</a>.','','7.22'),(1696,'/admin/help?render=overlay','default','Providing a help reference','','7.22'),(1697,'/admin/help?render=overlay','default','The Help module displays explanations for using each module listed on the main <a href=\"@help\">Help reference page</a>.','','7.22'),(1698,'/admin/help?render=overlay','default','Providing context-sensitive help','','7.22'),(1699,'/admin/help?render=overlay','default','The Help module displays context-sensitive advice and explanations on various pages.','','7.22'),(1700,'/admin/help?render=overlay','default','Provides some extended multilingual options for nodes.','','7.22'),(1701,'/admin/help?render=overlay','default','Additionally, if <em>String translation</em> enabled, this module will localize all content type configuration texts.','','7.22'),(1702,'/admin/help?render=overlay','default','Content type names','','7.22'),(1703,'/admin/help?render=overlay','default','Submission guidelines','','7.22'),(1704,'/admin/help?render=overlay','default','Content type descriptions were previously localized so they won\'t be affected.','','7.22'),(1705,'/admin/help?render=overlay','default','The Image module allows you to manipulate images on your website. It exposes a setting for using the <em>Image toolkit</em>, allows you to configure <em>Image styles</em> that can be used for resizing or adjusting images on display, and provides an <em>Image</em> field for attaching images to content. For more information, see the online handbook entry for <a href=\"@image\">Image module</a>.','','7.22'),(1706,'/admin/help?render=overlay','default','Manipulating images','','7.22'),(1707,'/admin/help?render=overlay','default','With the Image module you can scale, crop, resize, rotate and desaturate images without affecting the original image using <a href=\"@image\">image styles</a>. When you change an image style, the module automatically refreshes all created images. Every image style must have a name, which will be used in the URL of the generated images. There are two common approaches to naming image styles (which you use will depend on how the image style is being applied):','','7.22'),(1708,'/admin/help?render=overlay','default','Based on where it will be used: eg. <em>profile-picture</em>','','7.22'),(1709,'/admin/help?render=overlay','default','Describing its appearance: eg. <em>square-85x85</em>','','7.22'),(1710,'/admin/help?render=overlay','default','After you create an image style, you can add effects: crop, scale, resize, rotate, and desaturate (other contributed modules provide additional effects). For example, by combining effects as crop, scale, and desaturate, you can create square, grayscale thumbnails.','','7.22'),(1711,'/admin/help?render=overlay','default','Attaching images to content as fields','','7.22'),(1712,'/admin/help?render=overlay','default','Image module also allows you to attach images to content as fields. To add an image field to a <a href=\'@content-type\'>content type</a>, go to the content type\'s <em>manage fields</em> page, and add a new field of type <em>Image</em>. Attaching images to content this way allows image styles to be applied and maintained, and also allows you more flexibility when theming.','','7.22'),(1713,'/admin/help?render=overlay','default','The List module defines various fields for storing a list of items, for use with the Field module. Usually these items are entered through a select list, checkboxes, or radio buttons. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.22'),(1714,'/admin/help?render=overlay','default','The Locale module allows your Drupal site to be presented in languages other than the default English, and to be multilingual. The Locale module works by maintaining a database of translations, and examining text as it is about to be displayed. When a translation of the text is available in the language to be displayed, the translation is displayed rather than the original text. When a translation is unavailable, the original text is displayed, and then stored for review by a translator. For more information, see the online handbook entry for <a href=\"@locale\">Locale module</a>.','','7.22'),(1715,'/admin/help?render=overlay','default','Translating interface text','','7.22'),(1716,'/admin/help?render=overlay','default','Translations of text in the Drupal interface may be provided by:','','7.22'),(1717,'/admin/help?render=overlay','default','Translating within your site, using the Locale module\'s integrated <a href=\'@translate\'>translation interface</a>.','','7.22'),(1718,'/admin/help?render=overlay','default','Importing files from a set of existing translations, known as a translation package. A translation package enables the display of a specific version of Drupal in a specific language, and contains files in the Gettext Portable Object (<em>.po</em>) format. Although not all languages are available for every version of Drupal, translation packages for many languages are available for download from the <a href=\"@translations\">Drupal translations page</a>.','','7.22'),(1719,'/admin/help?render=overlay','default','If an existing translation package does not meet your needs, the Gettext Portable Object (<em>.po</em>) files within a package may be modified, or new <em>.po</em> files may be created, using a desktop Gettext editor. The Locale module\'s <a href=\'@import\'>import</a> feature allows the translated strings from a new or modified <em>.po</em> file to be added to your site. The Locale module\'s <a href=\'@export\'>export</a> feature generates files from your site\'s translated strings, that can either be shared with others or edited offline by a Gettext translation editor.','','7.22'),(1720,'/admin/help?render=overlay','default','Configuring a multilingual site','','7.22'),(1721,'/admin/help?render=overlay','default','Language negotiation allows your site to automatically change language based on the domain or path used for each request. Users may (optionally) select their preferred language on their <em>My account</em> page, and your site can be configured to honor a web browser\'s preferred language settings. Site content can be translated using the <a href=\'@content-help\'>Content translation module</a>.','','7.22'),(1722,'/admin/help?render=overlay','default','The Menu module provides an interface for managing menus. A menu is a hierarchical collection of links, which can be within or external to the site, generally used for navigation. Each menu is rendered in a block that can be enabled and positioned through the <a href=\"@blocks\">Blocks administration page</a>. You can view and manage menus on the <a href=\"@menus\">Menus administration page</a>. For more information, see the online handbook entry for the <a href=\"@menu\">Menu module</a>.','','7.22'),(1723,'/admin/help?render=overlay','default','Managing menus','','7.22'),(1724,'/admin/help?render=overlay','default','Users with the <em>Administer menus and menu items</em> permission can add, edit and delete custom menus on the <a href=\"@menu\">Menus administration page</a>. Custom menus can be special site menus, menus of external links, or any combination of internal and external links. You may create an unlimited number of additional menus, each of which will automatically have an associated block. By selecting <em>list links</em>, you can add, edit, or delete links for a given menu. The links listing page provides a drag-and-drop interface for controlling the order of links, and creating a hierarchy within the menu.','','7.22'),(1725,'/admin/help?render=overlay','default','Displaying menus','','7.22'),(1726,'/admin/help?render=overlay','default','After you have created a menu, you must enable and position the associated block on the <a href=\"@blocks\">Blocks administration page</a>.','','7.22'),(1727,'/admin/help?render=overlay','default','The Node module manages the creation, editing, deletion, settings, and display of the main site content. Content items managed by the Node module are typically displayed as pages on your site, and include a title, some meta-data (author, creation time, content type, etc.), and optional fields containing text or other data (fields are managed by the <a href=\"@field\">Field module</a>). For more information, see the online handbook entry for <a href=\"@node\">Node module</a>.','','7.22'),(1728,'/admin/help?render=overlay','default','Creating content','','7.22'),(1729,'/admin/help?render=overlay','default','When new content is created, the Node module records basic information about the content, including the author, date of creation, and the <a href=\"@content-type\">Content type</a>. It also manages the <em>publishing options</em>, which define whether or not the content is published, promoted to the front page of the site, and/or sticky at the top of content lists. Default settings can be configured for each <a href=\"@content-type\">type of content</a> on your site.','','7.22'),(1730,'/admin/help?render=overlay','default','Creating custom content types','','7.22'),(1731,'/admin/help?render=overlay','default','The Node module gives users with the <em>Administer content types</em> permission the ability to <a href=\"@content-new\">create new content types</a> in addition to the default ones already configured. Creating custom content types allows you the flexibility to add <a href=\"@field\">fields</a> and configure default settings that suit the differing needs of various site content.','','7.22'),(1732,'/admin/help?render=overlay','default','Administering content','','7.22'),(1733,'/admin/help?render=overlay','default','The <a href=\"@content\">Content administration page</a> allows you to review and bulk manage your site content.','','7.22'),(1734,'/admin/help?render=overlay','default','Creating revisions','','7.22'),(1735,'/admin/help?render=overlay','default','The Node module also enables you to create multiple versions of any content, and revert to older versions using the <em>Revision information</em> settings.','','7.22'),(1736,'/admin/help?render=overlay','default','User permissions','','7.22'),(1737,'/admin/help?render=overlay','default','The Node module makes a number of permissions available for each content type, which can be set by role on the <a href=\"@permissions\">permissions page</a>.','','7.22'),(1738,'/admin/help?render=overlay','default','The Number module defines various numeric field types for the Field module. Numbers can be in integer, decimal, or floating-point form, and they can be formatted when displayed. Number fields can be limited to a specific set of input values or to a range of values. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.22'),(1739,'/admin/help?render=overlay','default','The Options module defines checkbox, selection, and other input widgets for the Field module. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','7.22'),(1740,'/admin/help?render=overlay','default','The Overlay module makes the administration pages on your site display in a JavaScript overlay of the page you were viewing when you clicked the administrative link, instead of replacing the page in your browser window. Use the close link on the overlay to return to the page you were viewing when you clicked the link. For more information, see the online handbook entry for <a href=\"@overlay\">Overlay module</a>.','','7.22'),(1741,'/admin/help?render=overlay','default','The Path module allows you to specify an alias, or custom URL, for any existing internal system path. Aliases should not be confused with URL redirects, which allow you to forward a changed or inactive URL to a new URL. In addition to making URLs more readable, aliases also help search engines index content more effectively. Multiple aliases may be used for a single internal system path. To automate the aliasing of paths, you can install the contributed module <a href=\"@pathauto\">Pathauto</a>. For more information, see the online handbook entry for the <a href=\"@path\">Path module</a>.','','7.22'),(1742,'/admin/help?render=overlay','default','Creating aliases','','7.22'),(1743,'/admin/help?render=overlay','default','Users with sufficient <a href=\"@permissions\">permissions</a> can create aliases under the <em>URL path settings</em> section when they create or edit content. Some examples of aliases are: ','','7.22'),(1744,'/admin/help?render=overlay','default','<em>member/jane-smith</em> aliased to internal path <em>user/123</em>','','7.22'),(1745,'/admin/help?render=overlay','default','<em>about-us/team</em> aliased to internal path <em>node/456</em>','','7.22'),(1746,'/admin/help?render=overlay','default','Managing aliases','','7.22'),(1747,'/admin/help?render=overlay','default','The Path module provides a way to search and view a <a href=\"@aliases\">list of all aliases</a> that are in use on your website. Aliases can be added, edited and deleted through this list.','','7.22'),(1748,'/admin/help?render=overlay','default','The Shortcut module allows users to create sets of <em>shortcut</em> links to commonly-visited pages of the site. Shortcuts are contained within <em>sets</em>. Each user with <em>Select any shortcut set</em> permission can select a shortcut set created by anyone at the site. For more information, see the online handbook entry for <a href=\"@shortcut\">Shortcut module</a>.','','7.22'),(1749,'/admin/help?render=overlay','default','Administering shortcuts','','7.22'),(1750,'/admin/help?render=overlay','default','Users with the <em>Administer shortcuts</em> permission can manage shortcut sets and edit the shortcuts within sets from the <a href=\"@shortcuts\">Shortcuts administration page</a>.','','7.22'),(1751,'/admin/help?render=overlay','default','Choosing shortcut sets','','7.22'),(1752,'/admin/help?render=overlay','default','Users with permission to switch shortcut sets can choose a shortcut set to use from the Shortcuts tab of their user account page.','','7.22'),(1753,'/admin/help?render=overlay','default','Adding and removing shortcuts','','7.22'),(1754,'/admin/help?render=overlay','default','The Shortcut module creates an add/remove link for each page on your site; the link lets you add or remove the current page from the currently-enabled set of shortcuts (if your theme displays it and you have permission to edit your shortcut set). The core Seven administration theme displays this link next to the page title, as a small + or - sign. If you click on the + sign, you will add that page to your preferred set of shortcuts. If the page is already part of your shortcut set, the link will be a - sign, and will allow you to remove the current page from your shortcut set.','','7.22'),(1755,'/admin/help?render=overlay','default','Displaying shortcuts','','7.22'),(1756,'/admin/help?render=overlay','default','You can display your shortcuts by enabling the Shortcuts block on the <a href=\"@blocks\">Blocks administration page</a>. Certain administrative modules also display your shortcuts; for example, the core <a href=\"@toolbar-help\">Toolbar module</a> displays them near the top of the page, along with an <em>Edit shortcuts</em> link.','','7.22'),(1757,'/admin/help?render=overlay','default','The System module is integral to the site, and provides basic but extensible functionality for use by other modules and themes. Some integral elements of Drupal are contained in and managed by the System module, including caching, enabling and disabling modules and themes, preparing and displaying the administrative page, and configuring fundamental site settings. A number of key system maintenance operations are also part of the System module. For more information, see the online handbook entry for <a href=\"@system\">System module</a>.','','7.22'),(1758,'/admin/help?render=overlay','default','Managing modules','','7.22'),(1759,'/admin/help?render=overlay','default','The System module allows users with the appropriate permissions to enable and disable modules on the <a href=\"@modules\">Modules administration page</a>. Drupal comes with a number of core modules, and each module provides a discrete set of features and may be enabled or disabled depending on the needs of the site. Many additional modules contributed by members of the Drupal community are available for download at the <a href=\"@drupal-modules\">Drupal.org module page</a>.','','7.22'),(1760,'/admin/help?render=overlay','default','Managing themes','','7.22'),(1761,'/admin/help?render=overlay','default','The System module allows users with the appropriate permissions to enable and disable themes on the <a href=\"@themes\">Appearance administration page</a>. Themes determine the design and presentation of your site. Drupal comes packaged with several core themes, and additional contributed themes are available at the <a href=\"@drupal-themes\">Drupal.org theme page</a>.','','7.22'),(1762,'/admin/help?render=overlay','default','Managing caching','','7.22'),(1763,'/admin/help?render=overlay','default','The System module allows users with the appropriate permissions to manage caching on the <a href=\'@cache-settings\'>Performance settings page</a>. Drupal has a robust caching system that allows the efficient re-use of previously-constructed web pages and web page components. Pages requested by anonymous users are stored in a compressed format; depending on your site configuration and the amount of your web traffic tied to anonymous visitors, the caching system may significantly increase the speed of your site.','','7.22'),(1764,'/admin/help?render=overlay','default','Performing system maintenance','','7.22'),(1765,'/admin/help?render=overlay','default','In order for the site and its modules to continue to operate well, a set of routine administrative operations must run on a regular basis. The System module manages this task by making use of a system cron job. You can verify the status of cron tasks by visiting the <a href=\"@status\">Status report page</a>. For more information, see the online handbook entry for <a href=\"@handbook\">configuring cron jobs</a>. You can set up cron job by visiting <a href=\"@cron\">Cron configuration</a> page','','7.22'),(1766,'/admin/help?render=overlay','default','Configuring basic site settings','','7.22'),(1767,'/admin/help?render=overlay','default','The System module also handles basic configuration options for your site, including <a href=\"@date-time-settings\">Date and time settings</a>, <a href=\"@file-system\">File system settings</a>, <a href=\"@clean-url\">Clean URL support</a>, <a href=\"@site-info\">Site name and other information</a>, and a <a href=\"@maintenance-mode\">Maintenance mode</a> for taking your site temporarily offline.','','7.22'),(1768,'/admin/help?render=overlay','default','Configuring actions','','7.22'),(1769,'/admin/help?render=overlay','default','Actions are individual tasks that the system can do, such as unpublishing a piece of content or banning a user. Modules, such as the <a href=\"@trigger-help\">Trigger module</a>, can fire these actions when certain system events happen; for example, when a new post is added or when a user logs in. Modules may also provide additional actions. Visit the <a href=\"@actions\">Actions page</a> to configure actions.','','7.22'),(1770,'/admin/help?render=overlay','default','The Taxonomy module allows you to classify the content of your website. To classify content, you define <em>vocabularies</em> that contain related <em>terms</em>, and then assign the vocabularies to content types. For more information, see the online handbook entry for the <a href=\"@taxonomy\">Taxonomy module</a>.','','7.22'),(1771,'/admin/help?render=overlay','default','Creating vocabularies','','7.22'),(1772,'/admin/help?render=overlay','default','Users with sufficient <a href=\"@perm\">permissions</a> can create <em>vocabularies</em> and <em>terms</em> through the <a href=\"@taxo\">Taxonomy page</a>. The page listing the terms provides a drag-and-drop interface for controlling the order of the terms and sub-terms within a vocabulary, in a hierarchical fashion. A <em>controlled vocabulary</em> classifying music by genre with terms and sub-terms could look as follows:','','7.22'),(1773,'/admin/help?render=overlay','default','<em>vocabulary</em>: Music','','7.22'),(1774,'/admin/help?render=overlay','default','<em>term</em>: Jazz','','7.22'),(1775,'/admin/help?render=overlay','default','<em>sub-term</em>: Swing','','7.22'),(1776,'/admin/help?render=overlay','default','<em>sub-term</em>: Fusion','','7.22'),(1777,'/admin/help?render=overlay','default','<em>term</em>: Rock','','7.22'),(1778,'/admin/help?render=overlay','default','<em>sub-term</em>: Country rock','','7.22'),(1779,'/admin/help?render=overlay','default','<em>sub-term</em>: Hard rock','','7.22'),(1780,'/admin/help?render=overlay','default','You can assign a sub-term to multiple parent terms. For example, <em>fusion</em> can be assigned to both <em>rock</em> and <em>jazz</em>.','','7.22'),(1781,'/admin/help?render=overlay','default','Terms in a <em>free-tagging vocabulary</em> can be built gradually as you create or edit content. This is often done used for blogs or photo management applications.','','7.22'),(1782,'/admin/help?render=overlay','default','Assigning vocabularies to content types','','7.22'),(1783,'/admin/help?render=overlay','default','Before you can use a new vocabulary to classify your content, a new Taxonomy term field must be added to a <a href=\"@ctedit\">content type</a> on its <em>manage fields</em> page. When adding a taxonomy field, you choose a <em>widget</em> to use to enter the taxonomy information on the content editing page: a select list, checkboxes, radio buttons, or an auto-complete field (to build a free-tagging vocabulary). After choosing the field type and widget, on the subsequent <em>field settings</em> page you can choose the desired vocabulary, whether one or multiple terms can be chosen from the vocabulary, and other settings. The same vocabulary can be added to multiple content types, by using the \"Add existing field\" section on the manage fields page.','','7.22'),(1784,'/admin/help?render=overlay','default','Classifying content','','7.22'),(1785,'/admin/help?render=overlay','default','After the vocabulary is assigned to the content type, you can start classifying content. The field with terms will appear on the content editing screen when you edit or <a href=\"@addnode\">add new content</a>.','','7.22'),(1786,'/admin/help?render=overlay','default','Viewing listings and RSS feeds by term','','7.22'),(1787,'/admin/help?render=overlay','default','Each taxonomy term automatically provides a page listing content that has its classification, and a corresponding RSS feed. For example, if the taxonomy term <em>country rock</em> has the ID 123 (you can see this by looking at the URL when hovering on the linked term, which you can click to navigate to the listing page), then you will find this list at the path <em>taxonomy/term/123</em>. The RSS feed will use the path <em>taxonomy/term/123/feed</em> (the RSS icon for this term\'s listing will automatically display in your browser\'s address bar when viewing the listing page).','','7.22'),(1788,'/admin/help?render=overlay','default','Extending Taxonomy module','','7.22'),(1789,'/admin/help?render=overlay','default','There are <a href=\"@taxcontrib\">many contributed modules</a> that extend the behavior of the Taxonomy module for both display and organization of terms.','','7.22'),(1790,'/admin/help?render=overlay','default','The Text module defines various text field types for the Field module. A text field may contain plain text only, or optionally, may use Drupal\'s <a href=\'@filter-help\'>text filters</a> to securely manage HTML output. Text input fields may be either a single line (text field), multiple lines (text area), or for greater input control, a select box, checkbox, or radio buttons. If desired, the field can be validated, so that it is limited to a set of allowed values. See the <a href=\'@field-help\'>Field module help page</a> for more information about fields.','','7.22'),(1791,'/admin/help?render=overlay','default','The Toolbar module displays links to top-level administration menu items and links from other modules at the top of the screen. For more information, see the online handbook entry for <a href=\"@toolbar\">Toolbar module</a>.','','7.22'),(1792,'/admin/help?render=overlay','default','Displaying administrative links','','7.22'),(1793,'/admin/help?render=overlay','default','The Toolbar module displays a bar containing top-level administrative links across the top of the screen. Below that, the Toolbar module has a <em>drawer</em> section where it displays links provided by other modules, such as the core <a href=\"@shortcuts-help\">Shortcut module</a>. The drawer can be hidden/shown by using the show/hide shortcuts link at the end of the toolbar.','','7.22'),(1794,'/admin/help?render=overlay','default','The Content translation module allows content to be translated into different languages. Working with the <a href=\"@locale\">Locale module</a> (which manages enabled languages and provides translation for the site interface), the Content translation module is key to creating and maintaining translated site content. For more information, see the online handbook entry for <a href=\"@translation\">Content translation module</a>.','','7.22'),(1795,'/admin/help?render=overlay','default','Configuring content types for translation','','7.22'),(1796,'/admin/help?render=overlay','default','To configure a particular content type for translation, visit the <a href=\"@content-types\">Content types</a> page, and click the <em>edit</em> link for the content type. In the <em>Publishing options</em> section, select <em>Enabled, with translation</em> under <em>Multilingual support</em>.','','7.22'),(1797,'/admin/help?render=overlay','default','Assigning a language to content','','7.22'),(1798,'/admin/help?render=overlay','default','Use the <em>Language</em> drop down to select the appropriate language when creating or editing content.','','7.22'),(1799,'/admin/help?render=overlay','default','Translating content','','7.22'),(1800,'/admin/help?render=overlay','default','Users with the <em>translate content</em> permission can translate content, if the content type has been configured to allow translations. To translate content, select the <em>Translation</em> tab when viewing the content, select the language for which you wish to provide content, and then enter the content.','','7.22'),(1801,'/admin/help?render=overlay','default','Maintaining translations','','7.22'),(1802,'/admin/help?render=overlay','default','If editing content in one language requires that translated versions also be updated to reflect the change, use the <em>Flag translations as outdated</em> check box to mark the translations as outdated and in need of revision. Individual translations may also be marked for revision by selecting the <em>This translation needs to be updated</em> check box on the translation editing form.','','7.22'),(1803,'/admin/help?render=overlay','default','The Update manager module periodically checks for new versions of your site\'s software (including contributed modules and themes), and alerts administrators to available updates. In order to provide update information, anonymous usage statistics are sent to Drupal.org. If desired, you may disable the Update manager module from the <a href=\'@modules\'>Module administration page</a>. For more information, see the online handbook entry for <a href=\'@update\'>Update manager module</a>.','','7.22'),(1804,'/admin/help?render=overlay','default','The Update manager also allows administrators to update and install modules and themes through the administration interface.','','7.22'),(1805,'/admin/help?render=overlay','default','Checking for available updates','','7.22'),(1806,'/admin/help?render=overlay','default','A report of <a href=\"@update-report\">available updates</a> will alert you when new releases are available for download. You may configure options for the frequency for checking updates (which are performed during <a href=\"@cron\">cron</a> runs) and e-mail notifications at the <a href=\"@update-settings\">Update manager settings</a>  page.','','7.22'),(1807,'/admin/help?render=overlay','default','Performing updates through the user interface','','7.22'),(1808,'/admin/help?render=overlay','default','The Update manager module allows administrators to perform updates directly through the administration interface. At the top of the <a href=\"@modules_page\">modules</a> and <a href=\"@themes_page\">themes</a> pages you will see a link to update to new releases. This will direct you to the <a href=\"@update-page\">update page</a> where you see a listing of all the missing updates and confirm which ones you want to upgrade. From there, you are prompted for your FTP/SSH password, which then transfers the files into your Drupal installation, overwriting your old files. More detailed instructions can be found in the <a href=\"@update\">online handbook</a>.','','7.22'),(1809,'/admin/help?render=overlay','default','Installing new modules and themes through the user interface','','7.22'),(1810,'/admin/help?render=overlay','default','You can also install new modules and themes in the same fashion, through the <a href=\"@install\">install page</a>, or by clicking the <em>Install new module/theme</em> link at the top of the <a href=\"@modules_page\">modules</a> and <a href=\"@themes_page\">themes</a> pages. In this case, you are prompted to provide either the URL to the download, or to upload a packaged release file from your local computer.','','7.22'),(1811,'/admin/help?render=overlay','default','The User module allows users to register, log in, and log out. It also allows users with proper permissions to manage user roles (used to classify users) and permissions associated with those roles. For more information, see the online handbook entry for <a href=\"@user\">User module</a>.','','7.22'),(1812,'/admin/help?render=overlay','default','Creating and managing users','','7.22'),(1813,'/admin/help?render=overlay','default','The User module allows users with the appropriate <a href=\"@permissions\">permissions</a> to create user accounts through the <a href=\"@people\">People administration page</a>, where they can also assign users to one or more roles, and block or delete user accounts. If allowed, users without accounts (anonymous users) can create their own accounts on the <a href=\"@register\">Create new account</a> page.','','7.22'),(1814,'/admin/help?render=overlay','default','User roles and permissions','','7.22'),(1815,'/admin/help?render=overlay','default','<em>Roles</em> are used to group and classify users; each user can be assigned one or more roles. By default there are two roles: <em>anonymous user</em> (users that are not logged in) and <em>authenticated user</em> (users that are registered and logged in). Depending on choices you made when you installed Drupal, the installation process may have defined more roles, and you can create additional custom roles on the <a href=\"@roles\">Roles page</a>. After creating roles, you can set permissions for each role on the <a href=\"@permissions_user\">Permissions page</a>. Granting a permission allows users who have been assigned a particular role to perform an action on the site, such as viewing a particular type of content, editing or creating content, administering settings for a particular module, or using a particular function of the site (such as search).','','7.22'),(1816,'/admin/help?render=overlay','default','The <a href=\"@accounts\">Account settings page</a> allows you to manage settings for the displayed name of the anonymous user role, personal contact forms, user registration, and account cancellation. On this page you can also manage settings for account personalization (including signatures and user pictures), and adapt the text for the e-mail messages that are sent automatically during the user registration process.','','7.22'),(1817,'/admin/help?render=overlay','default','This module improves support for multilingual content in Drupal sites:','','7.22'),(1818,'/admin/help?render=overlay','default','Shows content depending on page language.','','7.22'),(1819,'/admin/help?render=overlay','default','Handles multilingual variables.','','7.22'),(1820,'/admin/help?render=overlay','default','Extended language option for chosen content types. For these content types transations will be allowed for all defined languages, not only for enabled ones.','','7.22'),(1821,'/admin/help?render=overlay','default','Provides a block for language selection and two theme functions: <em>i18n_flags</em> and <em>i18n_links</em>.','','7.22'),(1822,'/admin/help?render=overlay','default','This is the base module for several others adding different features:','','7.22'),(1823,'/admin/help?render=overlay','default','Multilingual menu items.','','7.22'),(1824,'/admin/help?render=overlay','default','Multilingual taxonomy adds a language field for taxonomy vocabularies and terms.','','7.22'),(1825,'/admin/help?render=overlay','default','For more information, see the online handbook entry for <a href=\"@i18n\">Internationalization module</a>.','','7.22'),(1826,'/admin/help?render=overlay','default','This module adds support for other modules to translate user defined strings. Depending on which modules you have enabled that use this feature you may see different text groups to translate.','','7.22'),(1827,'/admin/help?render=overlay','default','This works differently to Drupal standard localization system: The strings will be translated from the <a href=\"@configure-strings\">source language</a>, which defaults to the site default language (it may not be English), so changing the default language may cause all these translations to be broken.','','7.22'),(1828,'/admin/help?render=overlay','default','If you are missing strings to translate, use the <a href=\"@refresh-strings\">refresh strings</a> page.','','7.22'),(1829,'/admin/help?render=overlay','default','Read more on the <em>Internationalization handbook</em>: <a href=\"http://drupal.org/node/313293\">Translating user defined strings</a>.','','7.22'),(1830,'/admin/help?render=overlay','default','This module provides support for multilingual blocks.','','7.22'),(1831,'/admin/help?render=overlay','default','You can set up a language for a block or define it as translatable:','','7.22'),(1832,'/admin/help?render=overlay','default','Blocks with a language will be displayed only in pages with that language.','','7.22'),(1833,'/admin/help?render=overlay','default','Translatable blocks can be translated using the localization interface.','','7.22'),(1834,'/admin/help?render=overlay','default','Follow these steps to set up and start using your website:','','7.22'),(1835,'/admin/help?render=overlay','default','<strong>Configure your website</strong> Once logged in, visit the <a href=\"@admin\">administration section</a>, where you can <a href=\"@config\">customize and configure</a> all aspects of your website.','','7.22'),(1836,'/admin/help?render=overlay','default','<strong>Enable additional functionality</strong> Next, visit the <a href=\"@modules\">module list</a> and enable features which suit your specific needs. You can find additional modules in the <a href=\"@download_modules\">Drupal modules download section</a>.','','7.22'),(1837,'/admin/help?render=overlay','default','<strong>Customize your website design</strong> To change the \"look and feel\" of your website, visit the <a href=\"@themes\">themes section</a>. You may choose from one of the included themes or download additional themes from the <a href=\"@download_themes\">Drupal themes download section</a>.','','7.22'),(1838,'/admin/help?render=overlay','default','<strong>Start posting content</strong> Finally, you can <a href=\"@content\">add new content</a> for your website.','','7.22'),(1839,'/admin/help?render=overlay','default','For more information, refer to the specific topics listed in the next section or to the <a href=\"@handbook\">online Drupal handbooks</a>. You may also post at the <a href=\"@forum\">Drupal forum</a> or view the wide range of <a href=\"@support\">other support options</a> available.','','7.22'),(1840,'/admin/help?render=overlay','default','block','','7.22'),(1841,'/admin/help?render=overlay','default','contextual','','7.22'),(1842,'/admin/help?render=overlay','default','dashboard','','7.22'),(1843,'/admin/help?render=overlay','default','dblog','','7.22'),(1844,'/admin/help?render=overlay','default','field','','7.22'),(1845,'/admin/help?render=overlay','default','field_sql_storage','','7.22'),(1846,'/admin/help?render=overlay','default','field_ui','','7.22'),(1847,'/admin/help?render=overlay','default','file','','7.22'),(1848,'/admin/help?render=overlay','default','filter','','7.22'),(1849,'/admin/help?render=overlay','default','help','','7.22'),(1850,'/admin/help?render=overlay','default','image','','7.22'),(1851,'/admin/help?render=overlay','default','list','','7.22'),(1852,'/admin/help?render=overlay','default','menu','','7.22'),(1853,'/admin/help?render=overlay','default','no